import React, { useState, useEffect } from "react";
import axios from "axios";
import ReactCountryFlag from "react-country-flag";
import countryCodeLookup from "country-code-lookup";
import "../styles/custom.css";
import AnalysisResults from "./AnalysisResults";

interface FileData {
  pais: string;
  esquema: string;
  tabla: string;
  fecha: string;
}

interface ProcessedData {
  esquema: string;
  tabla: string;
  paises: Record<string, string>; // { CL: fecha, CO: fecha, ... }
}

interface AnalysisResult {
  clave: string;
  [key: string]: any; // Para las propiedades dinámicas como ISOAPL, ISOBMP, etc.
}

export default function Analysis() {
  const [data, setData] = useState<ProcessedData[]>([]);
  const [countries, setCountries] = useState<string[]>([]);
  const [showResults, setShowResults] = useState(false);
  const [analysisData, setAnalysisData] = useState<AnalysisResult[]>([]);
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/files")
      .then((res) => {
        // Procesar datos para agrupar por esquema y tabla
        const processed: Record<string, ProcessedData> = {};
        const countrySet = new Set<string>();

        res.data.forEach((file: FileData) => {
          const key = `${file.esquema}_${file.tabla}`;
          countrySet.add(file.pais);

          if (!processed[key]) {
            processed[key] = {
              esquema: file.esquema,
              tabla: file.tabla,
              paises: {},
            };
          }
          processed[key].paises[file.pais] = file.fecha.split("T")[0];
        });

        setCountries(Array.from(countrySet).sort());
        setData(Object.values(processed));
      })
      .catch((err) => console.error(err));
  }, []);

  const handleAnalyze = () => {
    setIsLoading(true);
    axios
      .get("http://localhost:5000/api/analyze-table")
      .then((res) => {
        setAnalysisData(res.data);
        setShowResults(true);
      })
      .catch((err) => console.error(err))
      .finally(() => setIsLoading(false));
  };

  // Obtener código de país ISO para las banderas
  const getCountryCode = (paisCode: string) => {
    const country =
      countryCodeLookup.byIso(paisCode) || countryCodeLookup.byFips(paisCode);
    return country?.iso2 || "CL"; // Default Chile si no se encuentra
  };

  if (showResults) {
    return (
      <AnalysisResults 
        data={analysisData} 
        onBack={() => setShowResults(false)} 
      />
    );
  }

  return (
    <div className="p-8 overflow-x-auto">
      <h1 className="text-2xl font-bold mb-6">Matriz de Archivos por País</h1>

      <div className="mb-4">
        <button 
          onClick={handleAnalyze}
          className="btn btn-primary"
          disabled={isLoading}
        >
          {isLoading ? (
            <>
              <span className="loading loading-spinner"></span>
              Analizando...
            </>
          ) : (
            "Analizar Tablas"
          )}
        </button>
      </div>

      <table className="table table-zebra w-full">
        <thead>
          <tr>
            <th>Esquema</th>
            <th>Tabla</th>
            {countries.map((country) => (
              <th key={country} className="text-center">
                <div className="flex flex-col items-center">
                  <ReactCountryFlag
                    countryCode={getCountryCode(country)}
                    svg
                    style={{ width: "1.5em", height: "1.5em" }}
                  />
                  <span>{country}</span>
                </div>
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.esquema}</td>
              <td>{item.tabla}</td>
              {countries.map((country) => (
                <td key={country} className="text-center">
                  {item.paises[country] ? (
                    <span className="badge badge-success">
                      {item.paises[country]}
                    </span>
                  ) : (
                    <span className="badge badge-error">×</span>
                  )}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
